import Ball from './Ball';

export default function Flask({ball}) {

    return (
        <div className='flask'>
            <div className='flaskChild'>
                <div className='flaskAbs'>
                    {ball.map( i=> <Ball num={i}/>)}
                </div>
            </div>
        </div>
    );
}
